import React, { useState } from 'react';
import DateFnsUtils from '@date-io/date-fns'; // choose your lib
import {
  DatePicker,
  KeyboardDatePicker,
  MuiPickersUtilsProvider,
} from '@material-ui/pickers';

const CustomDatePicker = (props: any) => {
  const [selectedDateFrom, handleDateFromChange] = useState<any>(new Date('2014-08-18'));
  const [selectedDateTo, handleDateToChange] = useState<any>(new Date('2014-08-18'));
  const [selectedDate, handleDateChange] = useState(new Date());

  return (
    <MuiPickersUtilsProvider utils={DateFnsUtils}>
      <DatePicker value={selectedDateFrom} onChange={handleDateFromChange} />
      <DatePicker value={selectedDateTo} onChange={handleDateToChange} />
      <KeyboardDatePicker
        autoOk
        variant="inline"
        inputVariant="outlined"
        label="With keyboard"
        format="MM-dd-yyyy"
        value={selectedDate}
        InputAdornmentProps={{ position: "start" }}
        onChange={(date: any) => handleDateChange(date)}
      />
    </MuiPickersUtilsProvider>
  );
}

export default CustomDatePicker;
